import { createSlice } from '@reduxjs/toolkit';

const userDataSlice = createSlice({
    name: 'userData',
    initialState:{
        id: 0,
        email: "",
        questionsId: [],
        confirmedMail : false,
        submitedExam: false,
        startedExam : false,
        examStartTime : 0
    },
    reducers:
    {
        changeUser(state, action)
        {
            state.id = action.payload.id;
            state.email = action.payload.email;
            state.questionsId = action.payload.questionsId;
            confirmedMail = action.payload.confirmedMail,
            submitedExam = action.payload.submitedExam,
            startedExam = action.payload.startedExam,
            examStartTime = action.payload.examStartTime
        }
    }
});

export const { changeUser } = userDataSlice.actions;
export const userReducer = userDataSlice.reducer;
